// DeliveryGuarantee: Обеспечение исполнения обязательств по поставке товара или выполнению работы. Если первая версия извещения размещена до даты начала действия оптимизационного законопроекта 44-ФЗ или проект первой версии принимается до даты начала действия оптимизационного законопроекта 44-ФЗ, то блок игнорируется при приеме, иначе контролируется обязательность и допускается указание, если «С поставщиком (подрядчиком, исполнителем) будет заключен контракт жизненного цикла» (notificationInfo/contractConditionsInfo/contractLifeCycleInfo) = TRUE Условие по игнорированию распространяется только при приеме извещений ЭЗК20
type DeliveryGuarantee struct {
	XMLName xml.Name `xml:"deliveryGuarantee,omitempty"`

	// Amount: Размер обеспечения. Контролируется обязательность заполнения, кроме вариантов: a) если, начиная с версии ЕИС 11.1, установлено ограничение «Закупка у субъектов малого предпринимательства и социально ориентированных некоммерческих организаций» в notificationInfo/restrictionsInfo/restrictionInfo/preferenseRequirementInfo/shortName в соответствии со справочником "Преимущества (требования, ограничения) к участникам закупки" (nsiPurchasePreferences) И b) если поле "Тип казначейского сопровождения" (notificationInfo/customerRequirementsInfo/customerRequirementInfo/bankSupportContractRequiredInfo/treasurySupportContractInfo/treasurySupportContractType) имеет значение "ADV - Расчеты по контракту в части выплаты аванса подлежат казначейскому сопровождению". В перечисленных выше случаях (выполняются условия a и b) контролируется недопустимость указания размера обеспечения
	Amount *base.MoneyType `xml:"amount,omitempty"`

	// Part: Доля от начальной (максимальной) цены контракта. Игнорируется при приёме. Рассчитывается автоматически как отношение размера обеспечения (amount) к Стоимости поставки товара или выполнения работы (contractLCConditionsInfo/price). Не игнорируется и контролируется обязательность заполнения для случаев: - если, начиная с версии ЕИС 11.1, установлено ограничение «Закупка у субъектов малого предпринимательства и социально ориентированных некоммерческих организаций» в notificationInfo/restrictionsInfo/restrictionInfo/preferenseRequirementInfo/shortName в соответствии со справочником "Преимущества (требования, ограничения) к участникам закупки" (nsiPurchasePreferences); - если поле "Тип казначейского сопровождения" (notificationInfo/customerRequirementsInfo/customerRequirementInfo/bankSupportContractRequiredInfo/treasurySupportContractInfo/treasurySupportContractType) имеет значение "ADV - Расчеты по контракту в части выплаты аванса подлежат казначейскому сопровождению
	Part *base.PercentRestr0100D2Type `xml:"part,omitempty"`
}

