	// Sid: Уникальный идентификатор этапа исполнения контракта в ЕИС. Игнорируется при приеме первой версии извещения. Назначается в ЕИС и заполняется при передаче. Назначается один раз при сохранении версии документа, в которой добавлен этап исполнения контракта, не меняется в следующих версиях. При приеме последующих версий используется для идентификации этапа исполнения контракта в разных версиях извещения. При приеме изменений извещения, если поле заполнено, то контролируется, что в предыдущей версии извещения найден этап с указанным значением sid
