// ContractGuaranteePaymentInfoType: Тип: Информация о платеже для обеспечения исполнения контракта, начиная с версии ЕИС 9.3
type ContractGuaranteePaymentInfoType struct {
	XMLName xml.Name

	// Amount: Размер обеспечения. Начиная с версии ЕИС 9.3: 1) Контролируется обязательность заполнения, кроме варианта, для которого установлено ограничение «Закупка у субъектов малого предпринимательства и социально ориентированных некоммерческих организаций» в notificationInfo/restrictionsInfo/restrictionInfo/preferenseRequirementInfo/shortName в соответствии со справочником "Преимущества (требования, ограничения) к участникам закупки" (nsiPurchasePreferences). 2) Если установлено ограничение «Закупка у субъектов малого предпринимательства и социально ориентированных некоммерческих организаций», то контролируется недопустимость указания размера обеспечения. Не допускается указание, если установлен признак «С поставщиком (подрядчиком, исполнителем) будет заключен контракт жизненного цикла» notificationInfo/contractConditionsInfo/contractLifeCycleInfo/contractLifeCycle (на извещения ЭЗК20, первые версии которых размещены до даты начала действия оптимизационного законопроекта 44-ФЗ или проекnы первых версий которых принимаются до даты начала действия оптимизационного законопроекта 44-ФЗ, данное условие не распространяется) Поле при выгрузке не заполняется если в извещении установлен признак "Требуется казначейское сопровождение контракта" (treasurySupportContractInfo\treasurySupportContractRequired) и в поле "Тип казначейского сопровождения" (treasurySupportContractInfo\treasurySupportContractRequired) указано "ADV - Расчеты по контракту в части выплаты аванса подлежат казначейскому сопровождению"
	Amount *base.MoneyType `xml:"amount,omitempty"`

	// Account: Платежные реквизиты. При приеме контролируется наличие у организации заказчика счетов с указанным БИК и расчетным счетом
	Account cmn.PaymentPropertysType `xml:"account"`

	// ProcedureInfo: Порядок внесения денежных средств в качестве обеспечения заявки (порядок предоставления обеспечения исполнения контракта)
	ProcedureInfo base.Text2000Type `xml:"procedureInfo"`

	// Part: Доля от начальной (максимальной) цены контракта. Игнорируется при приёме. Рассчитывается автоматически как отношение размера обеспечения (amount) к НМЦК (contractConditionsInfo/maxPriceInfo/maxPrice)в виде процента. Округляется до двух знаков в дробной части Не игнорируется при приеме и контролируется обязательность заполнения для случаев: - Начиная с версии ЕИС 9.3, при установленом ограничении «Закупка у субъектов малого предпринимательства и социально ориентированных некоммерческих организаций» в notificationInfo/restrictionsInfo/restrictionInfo/preferenseRequirementInfo/shortName в соответствии со справочником "Преимущества (требования, ограничения) к участникам закупки" (nsiPurchasePreferences); если поле "Тип казначейского сопровождения" (notificationInfo/customerRequirementsInfo/customerRequirementInfo/bankSupportContractRequiredInfo/treasurySupportContractInfo/treasurySupportContractType) имеет значение "ADV - Расчеты по контракту в части выплаты аванса подлежат казначейскому сопровождению" и способ ОППи не является способом с особенностями по энергосервисному контракту
	Part *base.PercentRestr0100D2Type `xml:"part,omitempty"`

	// DeliveryGuarantee: Обеспечение исполнения обязательств по поставке товара или выполнению работы. Если первая версия извещения размещена до даты начала действия оптимизационного законопроекта 44-ФЗ или проект первой версии принимается до даты начала действия оптимизационного законопроекта 44-ФЗ, то блок игнорируется при приеме, иначе контролируется обязательность и допускается указание, если «С поставщиком (подрядчиком, исполнителем) будет заключен контракт жизненного цикла» (notificationInfo/contractConditionsInfo/contractLifeCycleInfo) = TRUE Условие по игнорированию распространяется только при приеме извещений ЭЗК20
	DeliveryGuarantee *DeliveryGuarantee `xml:"deliveryGuarantee,omitempty"`

	// ServiceGuarantee: Обеспечение исполнения обязательств по последующему обслуживанию, эксплуатации (при наличии) в течение срока службы, ремонту и (или) утилизации поставленного товара или созданного в результате выполнения работы объекта капитального строительства или товара. Если первая версия извещения размещена до даты начала действия оптимизационного законопроекта 44-ФЗ или проект первой версии принимается до даты начала действия оптимизационного законопроекта 44-ФЗ, то блок игнорируется при приеме, иначе контролируется обязательность и допускается указание, если «С поставщиком (подрядчиком, исполнителем) будет заключен контракт жизненного цикла» (notificationInfo/contractConditionsInfo/contractLifeCycleInfo) = TRUE Условие по игнорированию распространяется только при приеме извещений ЭЗК20
	ServiceGuarantee *ServiceGuarantee `xml:"serviceGuarantee,omitempty"`
}

